import './SelfSummary.css';


function SelfSummary() {
    return (
        <div>
            <div className="row-2">
                <div className="column">
                    <div className="summary-card">
                        <h5>Information Systems + HCI @ Carnegie Mellon</h5>
                    </div>
                </div>
                <div className="column">
                    <div className="summary-card">
                        <h5>Information Systems + HCI @ Carnegie Mellon</h5>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default SelfSummary;
